import React from 'react'
import SearchBar from './SearchBar'
import { useState } from 'react'
function Champ() {
  const [champName, setChampName] = useState("");
  const setChamp = (name) => {
    setChampName(name);
  }
  return (
    <div className="image_box">
      <img src='images/Aatrox.jpg' alt='Select champ' className='champ_img' />
      <figure>
      <img className='champ_img' src={"images/"+champName+".jpg"} alt={"Select champ"} />
      </figure>
      <SearchBar champCall={setChamp}/>

    </div>
  )
}

export default Champ
